import Navbar from './Navbar';
import './home.css';

const home = () => {
    const page = "Home"
    return (  
        <div className="Home">
            <div>
                <Navbar page={page}/>
            </div>
            <div className="container">
                <div className="box">
                    <button className="mainbtn">Validation</button>
                    <button className="mainbtn">Validation</button>
                </div>
            </div>

        </div>
    );
}

export default home;
